import React from 'react'
import { Container, Row ,Col,Button } from 'react-bootstrap'
import {useState,useEffect} from 'react';
import {ArrowRight} from 'react-bootstrap-icons';
import { Header } from '../MyComponents/Header';

export const Home = () => {
    return (
        <>
        <Header/>
        <section className='home text-light' id='home'>
            <Container>
                <span className='tag-line'><h1 style={{fontSize:60}}>Welcome to my Portfolio</h1></span>
                <h1 style={{fontFamily:'cursive'}}>{`Hi I'm `}<span className='wrap'>Web developer</span></h1>
                <p>&nbsp;I'm Jyoti a Web Developer specialising in React.JS .
                Additionally,&nbsp;I have <br/>&nbsp;experience in HTML & CSS.&nbsp;I create Websites based on your needs.</p>
                <Button variant='link' to="/contact" onClick={()=> console.log('connect')}>Let's connect <ArrowRight size={25}/></Button>
            </Container>
        </section>
        </>
    )
}
